import React from 'react';
import { MDBIcon,MDBCol,MDBInput, MDBBtn,MDBCard, MDBCardBody} from "mdbreact";

class PostFrontToBack extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      titre: '',
      description:'',
      photo_produit:'',
      prix: ''

    };

    this.onChange = this.onChange.bind(this)
    this.handleUploadImage = this.handleUploadImage.bind(this);
  }
  onChange(event) {
    this.setState({
        [event.target.name]: event.target.value
    })
}
  handleUploadImage(ev) {
    ev.preventDefault();

    const data = new FormData();
    data.append('photo_produit', this.uploadInput.files[0]);
    data.append('titre',this.state.titre);
    data.append('description',this.state.description);
    data.append('prix',this.state.prix);

    fetch('http://localhost:8080/produit', {
      method: 'POST',
      body: data,
    }).then((response) => {
      response.json().then((body) => {
        this.setState({ photo_produit: `http://localhost:8080/produit/${body.photo_produit}` });
        console.log('ity ilay body.fil',body.photo_produit);

      });
    });
  }

  render() {
    return (

        <div> 

      <form onSubmit={this.handleUploadImage}>
        <label>Titre:</label>
        <input type="text" value={this.state.value}  onChange={this.onChange} name="titre" /><br></br>
        <label>Description:</label>
        <input type="text" value={this.state.value} onChange={this.onChange}  name="description" /><br></br>
        <label>Prix :</label>
        <input type="text" value={this.state.value} onChange={this.onChange}  name="prix" /><br></br>
        <label>Images de votre produit : </label>  
          <input ref={(ref) => { this.uploadInput = ref; }} type="file" name="photo_produit"/><br/>

          <button className="btn btn-primary">Ajouter votre produit</button>

      </form>
        <center>
      <MDBCol md="6">
            <MDBCard width="50%">
              <MDBCardBody>
                <form>
                  <p className="h4 text-center py-4">Ajouter votre produit</p>
                  <div className="grey-text">
                    <MDBInput
                      label="Nom du produit"
                      group
                      type="text"
                      validate
                      error="wrong"
                      success="right" value={this.state.value}  onChange={this.onChange} name="titre"
                    />
                    <MDBInput
                      label="DÃ©scription"
                      group
                      type="email"
                      validate
                      error="wrong"
                      success="right" value={this.state.value} onChange={this.onChange}
                    />
                    <MDBInput
                      label="Prix"
                      group
                      type="text"
                      validate
                      error="wrong"
                      success="right" type="text" value={this.state.value} onChange={this.onChange}  name="prix"
                    />

                    <MDBInput
                      group
                      type="file"
                      validate
                      error="wrong"
                      success="right" type="text" value={this.state.value} onChange={this.onChange}  name="prix"
                    />

                  </div>
                  <div className="text-center">
                  <div className="text-center mt-4">
                <button className="btn btn-outline-warning" type="submit">
                  Ajouter
                  <MDBIcon icon="paper-plane" className="ml-2" />
                </button>
              </div>
              </div>
                </form>
              </MDBCardBody>
            </MDBCard>
          </MDBCol>
          </center>
      </div>
    );
  }
}

export default PostFrontToBack;
